// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

//Trò chơi cá cược: owner sẽ tạo smart contract và tạo ra 3 đội để người chơi đặt tiền được quy định số đội và số slot đặt tiền của mỗi đội (giống nhau cho tất cả) 
//(vd: 3 đội: xanh - 25 slots, đỏ - 25 slots, vàng - 25 slots)
//Người chơi đặt tiền theo số tiền quy định (10 wei) và chọn 1 slot còn trong 1 đội bất kì, không thể chọn đội đã hết slot
//Khi owner công bố đội chiến thắng (1 trong các đội) => smart contract update khog cho người chơi đặt tiền nữa, những thành viên đội đó nhận về 20 wei, còn lại mất tiền
//Mỗi người chỉ được đặt 1 lần cho 1 slot trong các đội
contract Gamble {
    address public owner;   //địa chỉ chủ game
    bool public open = false;  //trạng thái đóng/mở của cổng đăng kí (chủ có thể mở/đóng trước khi công bố kết quả)
    bool public ended = false; //check khi công bố kết quả, hết game
    uint private i;     //biến để loop
    uint public winner; //biến chứa đội chiến thắng (set bởi owner)

    //struct 1 team
    struct Team {
        string name;    //tên đội
        uint slot_left; //số slot còn lại
    }

    //array chứa các team
    Team[] teams;         

    //Array check xem thành viên có tham gia chưa
    mapping(address => bool) players;

    //array xem thành viên đki team nào
    mapping(address => uint) players_team_pair;


    //Constructor
    constructor(uint _slot) public{
        owner = msg.sender;   //Owner
        //Tạo 3 team
        for (i = 0; i < 3; i++){
            Team memory teamm;
            teamm.name = "randomname";
            teamm.slot_left = _slot;
            teams.push(teamm);
        }
    }

    //Ng chơi đk tham gia 
    function Attend(uint team_id) public payable {
        require(open == true, "The game is over"); //check xem trò chơi còn mở cổng đki
        require(team_id < 3, "The team does not exist");    //check đúng id team
        require(teams[team_id].slot_left > 0, "Please select another team");    //check  team còn slot
        require(msg.value >= 10, "The fund is not sufficient"); // check trả đủ tiền
        require(players[msg.sender] == false, "You can attended once"); //check tham gia nhiều lần

        //Update ng chơi
        teams[team_id].slot_left = teams[team_id].slot_left - 1;
        players[msg.sender] = true;
        players_team_pair[msg.sender] = team_id;
    }

    function viewTeam() public view returns (uint){
        if (players[msg.sender] == true) {
            return players_team_pair[msg.sender];
        }
        else {
            return 404;
        }
    }

    //Owner mở cổng đki khi game chưa kết thúc
    function OpenGame() public {
        require(msg.sender == owner);
        require(ended == false);
        open = true;
    }

    //Owner đóng cổng đki khi game chưa kết thúc
    function CloseGame() public {
        require(msg.sender == owner);
        require(ended == false);
        open = false;
    }

    //Trò chơi kết thúc, owner chọn đội thắng (có thể đổi thành quay random)
    function EndGame() public {
        require(msg.sender == owner);
        require(ended == false); //chi co the chon 1 lan

        winner = randMod();
        open = false;
        ended = true;
    }

    uint randNonce = 0;

    // Defining a function to generate
    // a random number
    function randMod() internal returns(uint)
    {
        randNonce++; 
        return uint(keccak256(abi.encodePacked(block.timestamp,msg.sender,randNonce))) % 3;
    }

    //Ng chơi đội thắng rút tiền
    function WithdrawFund() public payable {
        require(players_team_pair[msg.sender] == winner, "You are not in winner team");
        payable(msg.sender).transfer(20);
    }
}
